import './button.css';
import Header from './header1';
import React from 'react';
import ReactDOM from "react-dom/client";
function EmButton() {
  return (
    <button className='btn'>
      Emergency
    </button>
  );
}
function LogButton(){
    return (<button className='mtl'>
        Log In
    </button>
    );
}

export default function MyApp() {
  return (
    <div className='first'>
        <Header/>
      <EmButton />
        <div className='sec'>
            <LogButton />
        </div>
    </div>
  );
}
